import React, {useState, useEffect} from 'react';
import { Link } from 'react-router-dom';
import {Nav, Navbar, Tab, Row, Col, Form} from 'react-bootstrap'
import styled from 'styled-components';
import { motion} from "framer-motion";

//logo
import logo from '../assets/PneuS-03.png'

const Styles = styled.div`
height: 100vh;
display:grid;
grid-template-areas:
      'navbar navbar'
      'leftbar rightbar'
      'searchbar searchbar';
grid-template-rows: repeat(5, 1fr);
grid-template-columns: repeat(2, 1fr);

.nav-bar{
    grid-area: navbar; 
    background:#444;
    grid-row:0.5fr;
    grid-column: 1fr 1fr;
}
.left-bar{
    grid-area: leftbar; 
    background:#333;
    grid-row:3fr;
    grid-column: 1fr;
}
.right-bar{
    grid-area: rightbar; 
    background:#eee;
    grid-row:3fr;
    grid-column: 1fr;

}
.search-bar{
    grid-area: searchbar; 
    background:#777;
    grid-row:1.5fr;
    grid-column: 1fr 1fr;
}

`;

function Header(props){
    return(
        <React.Fragment>
            <Styles>
                    <div className='nav-bar'> 1 </div>
                    <div className='left-bar'> 2 </div>
                    <div className='right-bar'> 3 </div>
                    <div className='search-bar'> 5 </div>
            </Styles>
        </React.Fragment>
    )
}
export default Header;
